function resizeMe(){var e=document.getElementById("content"),t=window.innerHeight;e.style.height=t-397+"px"}window.onload=function(){var e="";switch(window.location.pathname){case"/index.html":e={index:"active"};break;case"/about.html":e={about:"active"};break;case"/partners.html":e={partners:"active"};break;case"/careers.html":e={careers:"active"}}var t=Handlebars.templates.header(e);document.getElementById("header").innerHTML+=t;var a=Handlebars.templates.footer({year:(new Date).getFullYear()});document.getElementById("footer").innerHTML+=a,resizeMe()};